import React, { useState, useEffect } from 'react';
import { Route, Routes, Navigate } from 'react-router-dom';
import Login from '../superadmin/page/Login';
import Dashboard from '../superadmin/page/Dashboard';
import ManageDevice from '../superadmin/page/ManageDevice';
import ManageUsers from '../superadmin/page/ManageUsers';
import ManageUserRole from '../superadmin/page/ManageUserRole';
import ManageReseller from '../superadmin/page/ManageReseller';
import Profile from '../superadmin/page/Profile';
import ViewUserList from '../superadmin/page/ViewUserList';
import ManageDeviceList from '../superadmin/page/ManageDeviceList';
const SuperAdminApp = () => {
  const storedUser = JSON.parse(sessionStorage.getItem('superAdminUser'));
  const [loggedIn, setLoggedIn] = useState(!!storedUser);
  const [userInfo, setUserInfo] = useState(storedUser || {});

  useEffect(() => {
    if (storedUser) {
      setLoggedIn(true);
      setUserInfo(storedUser);
    }
  }, [storedUser]);

  const handleLogin = (data) => {
    const { email, ...rest } = data;
    setUserInfo({ email, ...rest });
    setLoggedIn(true);
    sessionStorage.setItem('superAdminUser', JSON.stringify({ email, ...rest }));
  };

  const handleLogout = () => {
    setLoggedIn(false);
    setUserInfo({});
    sessionStorage.removeItem('superAdminUser');
  };

  return (
    <Routes>
      <Route
        path="/"
        element={loggedIn ? <Navigate to="/superadmin/Dashboard" /> : <Login handleLogin={handleLogin} />}
      />
      <Route
        path="Dashboard"
        element={loggedIn ? (
          <Dashboard userInfo={userInfo} handleLogout={handleLogout} />
        ) : (
          <Navigate to="/superadmin" />
        )}
      />
      <Route
        path="ManageDevice"
        element={loggedIn ? (
          <ManageDevice userInfo={userInfo} handleLogout={handleLogout} />
        ) : (
          <Navigate to="/superadmin" />
        )}
      />
      <Route
        path="ManageUsers"
        element={loggedIn ? (
          <ManageUsers userInfo={userInfo} handleLogout={handleLogout} />
        ) : (
          <Navigate to="/superadmin" />
        )}
      />
      <Route
        path="ViewUserList"
        element={loggedIn ? (
          <ViewUserList userInfo={userInfo} handleLogout={handleLogout} />
        ) : (
          <Navigate to="/superadmin" />
        )}
      />
      <Route
        path="ManageUserRole"
        element={loggedIn ? (
          <ManageUserRole userInfo={userInfo} handleLogout={handleLogout} />
        ) : (
          <Navigate to="/superadmin" />
        )}
      />
      <Route
        path="ManageReseller"
        element={loggedIn ? (
          <ManageReseller userInfo={userInfo} handleLogout={handleLogout} />
        ) : (
          <Navigate to="/superadmin" />
        )}
      />
      <Route
        path="Profile"
        element={loggedIn ? (
          <Profile userInfo={userInfo} handleLogout={handleLogout} />
        ) : (
          <Navigate to="/superadmin" />
        )}
      />
    </Routes>
  );
};

export default SuperAdminApp;
